import logo from './logo.svg';
import styles from './App.module.scss';

function App() {
  useState;
  return (
    <div className={styles['App']}>
      <header className={styles['App-header']}>
        <div className={styles['content']}>
          <div className={styles['text-head']}>Study Result</div>
        </div>
      </header>
    </div>
  );
}

export default App;
